import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import img from '../images/icons8-docker-62.png';
import { Navigation, Pagination, Autoplay, EffectCards } from 'swiper/modules';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/autoplay';
import 'swiper/css/effect-cards';

import '../styles/swiper.css';

interface SwiperProps {
  spaceBetween: number;
  slidesPerView: number;
  navigation: boolean,
  pagination: { clickable: boolean },
  autoplay: { delay: number },
  effectCards: boolean,
  // onSlideChange: () => void;
  // onSwiper: (swiper: any) => void; // Substitua 'any' pelo tipo apropriado para o objeto swiper
}

const Projects: React.FC = () => {
    const swiperProps: SwiperProps = {
        spaceBetween: 50,
        slidesPerView: 3,
        navigation: true,
        pagination: { clickable: true },
        autoplay: { delay: 2000 },
        effectCards: true
        // onSlideChange: () => console.log('slide change'),
        // onSwiper: (swiper) => console.log(swiper)
    };
    return (
      <Swiper modules={[Navigation, Pagination, Autoplay, EffectCards]} {...swiperProps}>
        <SwiperSlide>
            <img src={ img } alt='img' />
        </SwiperSlide>
        <SwiperSlide>
            <img src={ img } alt='img' />
        </SwiperSlide>
        <SwiperSlide>
            <img src={ img } alt='img' />
        </SwiperSlide>
        <SwiperSlide>
            <img src={ img } alt='img' />
        </SwiperSlide>
      </Swiper>
    );
};

export default Projects;
